import { image as Image } from "~/../db/schema";
import { InferSelectModel, InferInsertModel } from "drizzle-orm";
import { createInsertSchema, createSelectSchema } from "drizzle-zod";

// TS
export type SelectImage = InferSelectModel<typeof Image>;
export type InsertImage = InferInsertModel<typeof Image>;

// Zod
export const SelectImageSchema = createSelectSchema(Image);
export const InsertImageSchema = createInsertSchema(Image);

// Default
export const defaultSelectImage: SelectImage = {
  id: "",
  dataUrl:
    "data:image/png;base64,",
  main_weaponId: null,
  sub_weaponId: null,
  body_armorId: null,
  additional_equipmentId: null,
  special_equipmentId: null,
};
export const defaultInsertImage: InsertImage = {
  id: "",
  dataUrl: "",
};
